import {library} from '@fortawesome/fontawesome-svg-core';
import
{
    faLock,
    faAngleDown,
    faShoppingCart,
    faUserCircle
} from '@fortawesome/free-solid-svg-icons';

library.add
(
    faLock,
    faAngleDown,faShoppingCart,faUserCircle);
